 
from text_extrator.preprocessing import is_base64_image

def test_valid_base64_images():
    test = '''
![Image](data:image/png;base64,)

Received 31 January 2023, accepted 16 February 2023, date of publication 22 February 2023, date of current version 28 February 2023.
'''
    valid_images = [
        test,
        "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mP8/5+hHgAHggJ/PchI7wAAAABJRU5ErkJggg==",
        "data:image/jpeg;base64,",
        "data:image/jpg;base64,ABC123+/=",
        "data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7",
        "data:image/bmp;base64,Qk1GAAAAAAAAADYAAAAoAAAAAQAAAAEAAAABACAAAAAAAAAAAADEDgAAxA4AAAAAAAAAAAAA",
        "data:image/webp;base64,UklGRiIAAABXRUJQVlA4IBYAAAAwAQCdASoBAAEADsD+JaQAA3AAAAAA"
    ]
    
    for img in valid_images:
        if is_base64_image(img):
            print(f"Base 64: {img[:50]}...")
 
test_valid_base64_images()